class User {
  final int id;
  final String name;
  final String userName;
  final String email;
  final String? profileImage;
  final String? phoneNumber;

  User({
    required this.id,
    required this.name,
    required this.userName,
    required this.email,
    this.profileImage,
    this.phoneNumber,
  });

  factory User.fromMap(Map<String, dynamic> map) {
    return User(
      id: map["id"],
      name: map["name"],
      userName: map["username"],
      email: map["email"],
      profileImage: map["profile_photo"],
      phoneNumber: map["phone_number"],
    );
  }

  ///[* data profile]
  factory User.dummy() {
    return User(
      id: 027,
      name: "Salya Ilyasa",
      userName: "Kelompok 7",
      email: "2006027@itg.ac.id",
      profileImage:
          "data:image/jpeg;base64,",
      phoneNumber: "0895428493355",
    );
  }
}